import "./App.css";

function App() {
  const reqBody = {
    username: "trevor",
    password: "asdfasdf",
  };
  fetch("api/auth/login", {
    headers: {
      "Content-Type": "application/json",
    },
    method: "post",
    body: JSON.stringify(reqBody),
  }).then((response) => console.log(response));
  return (
    <div className="App">
      <h1> Hello world</h1>
    </div>
  );
}

export default App;
